orderConfirmHandler=n=>{const t=n.action.substring(n.action.lastIndexOf("=")+1);return confirm(`bạn có mún duyệt đơn hàng có id =${t} không ?`)?!0:!1};orderCancleHandler=n=>{const t=n.action.substring(n.action.lastIndexOf("=")+1);return confirm(`bạn có mún hủy đơn hàng có id =${t} không ?`)?!0:!1};getOrderDetail=n=>($.ajax({type:"GET",url:n.action,success:function(n){var t=document.querySelector(".container-order-detail .card");t.innerHTML=n;$("#form-modal").modal("show")}}),!1);